import React, { useState } from 'react';
import { useForm } from 'react-hook-form';
import * as yup from 'yup';
import axios from 'axios';
import { useTracked } from './path-to-useTracked'; // Assuming you have a custom useTracked hook
import { setItem } from './path-to-utils'; // Assuming you have a utility function to set items in localStorage
import { authApiEndpoints } from './path-to-api-endpoints'; // Assuming you have an API endpoints configuration
import { Messages } from 'primereact/messages';
import LocaleToggle from './LocaleToggle'; // Assuming LocaleToggle is a custom component
import Card from '@mui/material/Card';
// Validation schema using Yup
const loginValidationSchema = yup.object().shape({
  email: yup.string().email('Invalid email format').required('Email is required'),
  password: yup.string().required('Password is required'),
});

const Login = (props) => {
  const [state, setState] = useTracked();
  const [submitting, setSubmitting] = useState(false);
  let messages = React.useRef(null); // Create a reference for the Messages component

  // useForm hook
  const { register, handleSubmit, errors } = useForm({
    validationSchema: loginValidationSchema
  });

  const submitLogin = (data) => {
    messages.current.clear(); // Clear existing messages
    setSubmitting(true);
    axios.post(authApiEndpoints.login, JSON.stringify(data))
      .then(response => {
        if (response.status === 200) {
          setItem('expires_in', response.data.expires_in);
          setItem('access_token', response.data.access_token);
          setItem('token_created', response.data.token_created);

          setState(prev => ({ ...prev, user: response.data.user }));

          props.location.state === undefined ? props.history.replace('/dashboard') : props.history.replace(props.location.state.from.pathname);
        }
      })
      .catch(error => {
        if (error.response && error.response.status === 422) {
          messages.current.show({ severity: 'error', detail: 'Incorrect email or password.', sticky: true });
        } else {
          messages.current.show({ severity: 'error', detail: 'Something went wrong. Try again.', sticky: true });
        }
        setSubmitting(false);
      });
  };

  return (
    <div className="p-grid p-nogutter p-align-center p-justify-center" style={{ height: '95vh' }}>
      <Card className="p-sm-12 p-md-6 p-lg-4" style={{ borderRadius: 5, minHeight: 65 }}>
        <div className="p-col-12 p-fluid">
          <Messages ref={messages} />
        </div>
        <div className="p-col-12">
          <div className="p-card-title p-grid p-nogutter p-justify-between">
            Login <LocaleToggle />
          </div>
          <div className="p-card-subtitle">Enter login credentials</div>
        </div>
        <form onSubmit={handleSubmit(submitLogin)} className="p-col-12">
          <div className="p-field">
            <label htmlFor="email">Email</label>
            <input
              id="email"
              name="email"
              type="email"
              ref={register}
              className={`p-inputtext p-component ${errors.email ? 'p-invalid' : ''}`}
              placeholder="Enter your email"
            />
            {errors.email && <small className="p-error">{errors.email.message}</small>}
          </div>
          <div className="p-field">
            <label htmlFor="password">Password</label>
            <input
              id="password"
              name="password"
              type="password"
              ref={register}
              className={`p-inputtext p-component ${errors.password ? 'p-invalid' : ''}`}
              placeholder="Enter your password"
            />
            {errors.password && <small className="p-error">{errors.password.message}</small>}
          </div>
          <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
      <Button variant="contained" color="secondary" onClick={handleClick}>
        Centered Button
      </Button>
    </div>
        </form>
      </Card>
    </div>
  );
};

export default Login;
